import Header from "../../components/Header/Header"
import Introduction from "../../components/Introduction/Introduction"
import PhotoBackgroud from "../../components/PhotoBackground/PhotoBackground";

function AboutPage(props) {
  return (
    <>
      <Header
        text={props.text.header}
        languages={props.languages}
        curLang={props.currLang}
        setLanguage={props.setLanguage}
        links={props.links}
      ></Header>
      <Introduction definition={props.text.experience.definition} advertice={props.text.introduction.list}/>
      <PhotoBackgroud team={props.text.backgroundImage}/>
    </>
  );
}

export default AboutPage;
